import React from 'react';
import MilkList from './Components/MilkList';
import { Route, Routes, Router } from "react-router-dom";



function App() {
  return (
      <div className="App">
        <Router>
            <Route path="/" element={<MilkList />} />
        </Router>
      </div>
  );
}

export default App;
